import {BrowserRouter, Route, Routes } from 'react-router-dom'
import Home from './Home'

function App() {
  return (
    <BrowserRouter>      
      <h1>테스트</h1>
      <Routes>
        <Route path='' exact element={Home}>

        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
